import React from "react";
import { useParams } from "react-router-dom";
import biograms from "../biograms";

const BiogramPage = () => {
  const { name } = useParams();
  const biogram = biograms[name];
  return (
    <div>
      {biogram?.desc} {name}
    </div>
  );
};

export default BiogramPage;
